import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header>
      <div className="menu">
        <img src={Menu} alt="" width="20" />
      </div>
      <div className="logo">
        <h1>
          <Link to="/">Nike</Link>
        </h1>
      </div>
      <nav>
        <ul>
            <li><Link to='/'>Home</Link></li>
            <li><Link to='/'>Product</Link></li>
            <li><Link to='/'>Contact</Link></li>
            <li><Link to='/'>Contact</Link></li>
            <li><Link to='/'>Login | Register</Link></li>
            <li><Link to='/'>Home</Link></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
